304e63ac-035b-4037-a990-f44d33022b43	Мед гречишный 3л/4,3кг. Сбор 2024 года.	Гречишный мед\r\n\r\nМед гречишный обладает терпким и ярким ароматом, а так же неповторимым и узнаваемым вкусом. Отличается темно-коричневым цветом с красноватым оттенком, после кристаллизации значительно светлеет - просим обратить на это внимание, цвет может незначительно отличаться от того, что представлен на фотографиях. Кристаллизация как правило мягкая, с крупными кристаллами.\r\n\r\nВ состав гречишного меда входят полезные нутриенты, такие как:\r\n​\r\n● минеральные вещества – калий, магний, кальций, натрий, хлор, фосфор, железо, цинк, марганец, фтор, сера;\r\n● витамины – аскорбиновая (C), фолиевая (B9), пантотеновая (B5) кислоты, тиамин (B1), рибофлавин (B2), пиридоксин (B6), биотин (H);\r\n● органические и неорганические кислоты – молочная, винная, лимонная, яблочная, щавелевая, муравьиная, уксусная, фосфорная;\r\n● ароматические вещества (более 200).\r\n\r\nПолезные свойства гречишного меда:\r\n​\r\nСвойства гречишного меда позволяют использовать его в кулинарии, косметологии, лечебных целях. Главное его качество – мощная поддержка иммунной системы, особенно в осенне-зимний период. Гречишный мед помогает бороться с вирусной, бактериальной инфекцией, обладает противовоспалительными свойствами. При кашле оказывает отхаркивающее действие, способствует естественному очищению бронхов от мокроты. При регулярном употреблении укрепляются стенки сосудов. Мед из гречихи − сильный детоксикатор, он выводит отравляющие вещества из печени, способствует возобновление ее клеток. Его можно включать в рацион людям с тяжелыми формами ожирения. В небольших количествах разрешено употреблять пациентам с сахарным диабетом 1 типа. В продукте содержится полезная фруктоза, для ее усвоения инсулин не требуется.\r\n\r\nПриобретая натуральный гречишный мед у нас, вы можете быть уверены в его качестве и пользе для здоровья.	3500.00	Мед гречишный обладает терпким и ярким ароматом, а так же неповторимым и узнаваемым вкусом. Отличается темно-коричневым цветом с красноватым оттенком, после кристаллизации значительно светлеет. Кристаллизация как правило мягкая, с крупными кристаллами.\r\n	32	21	21	5500	100	6280efdc-4ed1-401a-9706-7764c176803c	true	1	2025-04-28 12:09:24.583757	2025-04-28 12:33:03.914306
